import Img1 from "./benze1.jpeg";
import Img2 from "./benze2.webp";
import "./curosal.css"

function curosal(){
    return(
    <div className="slideshow">
        <div className="slide1">1/3</div>
        <div id="carousel_slide1"></div>
        <a href="#carousel__slide4" class="carousel__prev">Go to last slide</a>
        <a href="#carousel__slide2" class="carousel__next">Go to next slide</a>
        <img src={Img1} className="Img1" alt="Benze car1"/>

   <div id="carousel_slide2"></div>
        <div className="sildeshow2">2/3</div>
        <img src={Img2} className="Img2" alt="Benze car2"/>





    </div>
    );
}
export default curosal;
